description:
Verenigde Staten
Komedie / Actie
110 minuten

een goeie film

met Steve Carell, Anne Hathaway en Dwayne Johnson

Maxwell Smart is een spion voor CONTROL, een organisatie die helaas door de overheid niet zo financieel ondersteund wordt als 
de CIA. Samen met zijn partner, de mooie Agent 99, is Smart op zoek naar leden van de terroristische organisatie CHAOS, die 
allerhande slechte plannen hebben met de wereld.
